import React from 'react';
import ReactDom from 'react-dom';

var date = new Date(2020, 10, 3, 14);
let cssStyle = { };
if(date.getHours() < 12){
  var strTime = 'Morning';
  cssStyle = {color:green};
}else if(date.getHours() > 12 && date.getHours() < 20 ){
  var strTime = 'Afternoon';
  cssStyle = {color:orange};
}else {
  var strTime = 'Evening';
  cssStyle = {color:purple};
}
ReactDom.render(
  <>
  <h1>Hello Sir, <span style={cssStyle}>Good {strTime}</span>
  </h1>
  </>
  ,
  document.getElementById('root')
)
